import React from "react";
import Header from "../Header/Header";
import "./Background.scss";

function Background() {
  return (
    <div>
      <video playsinline autoPlay muted loop>
        <source src={crypto} type="video/mp4" />
      </video>
      <Header />
    </div>
  );
}

export default Background;
